import React from 'react';
import { Link } from 'react-router-dom';
import './sidebar.css';

const Sidebar = ({ setActive }) => {
  const handleSidebarClick = (section) => {
    setActive(section);
  };

  return (
    <div className="sidebar">
      <Link to="/dashboard" className="sidebar-item" onClick={() => handleSidebarClick('dashboard')}>
        Dashboard
      </Link>
      <Link to="/apikeys" className="sidebar-item" onClick={() => handleSidebarClick('apiKeys')}>
        API Keys
      </Link>
      <Link to="/sdks" className="sidebar-item" onClick={() => handleSidebarClick('sdk')}>
        SDKs
      </Link>
      <Link to="/deployments" className="sidebar-item" onClick={() => handleSidebarClick('deployments')}>
        Deployments
      </Link>
      <Link to="/wizard" className="sidebar-item" onClick={() => handleSidebarClick('wizard')}>
        Wizard
      </Link>
    </div>
  );
};

export default Sidebar;
